import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { ArrowLeftIcon, PlusIcon, TrashIcon, PencilIcon } from '@heroicons/react/24/outline';
import { Link } from 'react-router-dom';

function TableConfig() {
  const [tables, setTables] = useState([]);
  const [newTableName, setNewTableName] = useState('');
  const [editingTable, setEditingTable] = useState(null);
  const [isLoading, setIsLoading] = useState(false);

  useEffect(() => {
    loadTables();
  }, []);

  const loadTables = async () => {
    try {
      const response = await axios.get('http://localhost:8000/api/tables');
      setTables(response.data);
    } catch (error) {
      console.error('Error loading tables:', error);
    }
  };

  const addTable = async () => {
    if (!newTableName.trim()) return;
    setIsLoading(true);
    try {
      await axios.post('http://localhost:8000/api/tables', { table_name: newTableName });
      setNewTableName('');
      await loadTables();
    } catch (error) {
      console.error('Error adding table:', error);
    }
    setIsLoading(false);
  };

  const deleteTable = async (tableName) => {
    if (!window.confirm(`Are you sure you want to remove ${tableName} from the configuration?`)) return;
    try {
      await axios.delete(`http://localhost:8000/api/tables/${tableName}`);
      await loadTables();
    } catch (error) {
      console.error('Error deleting table:', error);
    }
  };

  const updateTableDescription = async (tableName, description) => {
    try {
      await axios.put(`http://localhost:8000/api/tables/${tableName}`, { description });
      await loadTables();
      setEditingTable(null);
    } catch (error) {
      console.error('Error updating table description:', error);
    }
  };

  return (
    <div className="min-h-screen bg-[#0a0118] relative overflow-hidden">
      {/* Animated Background */}
      <div className="absolute inset-0 overflow-hidden">
        <div className="absolute -inset-[10px] opacity-50">
          <div className="absolute top-[10%] left-[20%] w-[500px] h-[500px] bg-purple-500 rounded-full mix-blend-multiply filter blur-[128px] animate-blob animation-delay-2000"></div>
          <div className="absolute top-[20%] right-[20%] w-[500px] h-[500px] bg-blue-500 rounded-full mix-blend-multiply filter blur-[128px] animate-blob"></div>
          <div className="absolute bottom-[20%] left-[30%] w-[500px] h-[500px] bg-indigo-500 rounded-full mix-blend-multiply filter blur-[128px] animate-blob animation-delay-4000"></div>
        </div>
      </div>

      {/* Content */}
      <div className="relative z-10">
        {/* Header */}
        <div className="bg-opacity-20 bg-black backdrop-blur-lg border-b border-white/10">
          <div className="max-w-4xl mx-auto px-4 py-6">
            <div className="flex items-center justify-between">
              <div className="flex items-center space-x-3">
                <Link to="/" className="text-purple-400 hover:text-purple-300 transition-colors">
                  <ArrowLeftIcon className="h-6 w-6" />
                </Link>
                <h1 className="text-3xl font-bold text-white">Table Configuration</h1>
              </div>
            </div>
          </div>
        </div>

        {/* Main Content */}
        <div className="max-w-4xl mx-auto px-4 py-8">
          {/* Add New Table */}
          <div className="mb-8 bg-opacity-20 bg-black backdrop-blur-xl rounded-3xl shadow-2xl border border-white/10 p-6">
            <h2 className="text-xl font-medium text-white mb-4">Add New Table</h2>
            <div className="flex space-x-4">
              <input
                type="text"
                value={newTableName}
                onChange={(e) => setNewTableName(e.target.value)}
                placeholder="Enter table name..."
                className="flex-1 bg-white/5 text-purple-100 rounded-xl px-4 py-2 border border-purple-500/30 focus:border-purple-400 focus:ring-2 focus:ring-purple-400/20 focus:outline-none placeholder-purple-300/30"
              />
              <button
                onClick={addTable}
                disabled={isLoading || !newTableName.trim()}
                className="inline-flex items-center px-4 py-2 border border-purple-500/30 text-sm font-medium rounded-xl text-white bg-purple-500/20 hover:bg-purple-500/30 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-purple-400/30 disabled:opacity-50 disabled:cursor-not-allowed transition-colors"
              >
                <PlusIcon className="h-5 w-5 mr-2" />
                Add Table
              </button>
            </div>
          </div>

          {/* Table List */}
          <div className="space-y-4">
            {tables.map((table) => (
              <div
                key={table.name}
                className="bg-opacity-20 bg-black backdrop-blur-xl rounded-3xl shadow-2xl border border-white/10 p-6"
              >
                <div className="flex items-center justify-between mb-4">
                  <h3 className="text-lg font-medium text-white">{table.name}</h3>
                  <div className="flex space-x-2">
                    <button
                      onClick={() => setEditingTable(editingTable === table.name ? null : table.name)}
                      className="p-2 text-purple-200/70 hover:text-white transition-colors rounded-lg hover:bg-purple-500/20"
                    >
                      <PencilIcon className="h-5 w-5" />
                    </button>
                    <button
                      onClick={() => deleteTable(table.name)}
                      className="p-2 text-red-400/70 hover:text-red-400 transition-colors rounded-lg hover:bg-red-500/20"
                    >
                      <TrashIcon className="h-5 w-5" />
                    </button>
                  </div>
                </div>

                {/* Schema Information */}
                <div className="space-y-4">
                  <div className="bg-black/30 rounded-lg p-4 border border-purple-500/20">
                    <h4 className="text-sm font-medium text-purple-200/70 mb-2">Columns</h4>
                    <div className="grid grid-cols-3 gap-4">
                      {table.columns.map((column) => (
                        <div key={column.name} className="text-purple-100">
                          <span className="font-mono text-sm">{column.name}</span>
                          <span className="text-purple-300/50 text-xs ml-2">({column.type})</span>
                        </div>
                      ))}
                    </div>
                  </div>

                  <div className="bg-black/30 rounded-lg p-4 border border-purple-500/20">
                    <h4 className="text-sm font-medium text-purple-200/70 mb-2">Description</h4>
                    {editingTable === table.name ? (
                      <div className="space-y-2">
                        <textarea
                          value={table.description}
                          onChange={(e) => {
                            const updatedTables = tables.map(t =>
                              t.name === table.name ? { ...t, description: e.target.value } : t
                            );
                            setTables(updatedTables);
                          }}
                          className="w-full bg-white/5 text-purple-100 rounded-lg px-3 py-2 border border-purple-500/30 focus:border-purple-400 focus:ring-2 focus:ring-purple-400/20 focus:outline-none"
                          rows={4}
                        />
                        <div className="flex justify-end space-x-2">
                          <button
                            onClick={() => setEditingTable(null)}
                            className="px-3 py-1 text-sm text-purple-200/70 hover:text-white transition-colors"
                          >
                            Cancel
                          </button>
                          <button
                            onClick={() => updateTableDescription(table.name, table.description)}
                            className="px-3 py-1 text-sm bg-purple-500/20 hover:bg-purple-500/30 text-white rounded-lg transition-colors"
                          >
                            Save
                          </button>
                        </div>
                      </div>
                    ) : (
                      <p className="text-purple-100 whitespace-pre-wrap">{table.description}</p>
                    )}
                  </div>

                  {/* Sample Data */}
                  <div className="bg-black/30 rounded-lg p-4 border border-purple-500/20">
                    <h4 className="text-sm font-medium text-purple-200/70 mb-2">Sample Data</h4>
                    <div className="overflow-x-auto">
                      <table className="min-w-full divide-y divide-purple-500/20">
                        <thead>
                          <tr>
                            {table.columns.map((column) => (
                              <th
                                key={column.name}
                                className="px-4 py-2 text-left text-xs font-medium text-purple-200/70 uppercase tracking-wider"
                              >
                                {column.name}
                              </th>
                            ))}
                          </tr>
                        </thead>
                        <tbody className="divide-y divide-purple-500/20">
                          {table.sample_data.map((row, i) => (
                            <tr key={i}>
                              {Object.values(row).map((cell, j) => (
                                <td key={j} className="px-4 py-2 text-sm text-purple-100">
                                  {String(cell)}
                                </td>
                              ))}
                            </tr>
                          ))}
                        </tbody>
                      </table>
                    </div>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default TableConfig;
